// You can import Ionicons from @expo/vector-icons if you use Expo or
// react-native-vector-icons/Ionicons otherwise.
import * as React from 'react';
import { Text, View } from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { NavigationContainer } from '@react-navigation/native';

import * as firebase from 'firebase';
import { firebaseConfig } from './components/config'
if (!firebase.apps.length) {
  firebase.initializeApp(firebaseConfig);
}

//custom fonts
import * as Font from 'expo-font';
import Navigator from './routes/homeStack';
import { MaterialIcons } from '@expo/vector-icons';

import { AppLoading } from 'expo';
import { globalStyles } from './styles/global';

//SCREENS
import Home from './screens/home'
import Connect from './screens/connect'
import Events from './screens/events'
import Listen from './screens/loginscreens/profile'
import Browser from './screens/browser'
import TestScreen from './screens/testscreen'

const getFonts = () => Font.loadAsync({
  'monsterrat-regular': require('./assets/fonts/Montserrat-Regular.ttf'),
  'monsterrat-bold': require('./assets/fonts/Montserrat-Bold.ttf'),
  'monsterrat-light': require('./assets/fonts/Montserrat-Light.ttf')

});



function HomeScreen() {
  return (
     <Home />
    );
}

function ConnectScreen() {
  return (

      <Connect/>

  );
}
function EventsScreen() {
  return (
    <Events/>
  );
}
function GiveScreen() {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
    <TestScreen/>
    </View>
  );
}
function ListenScreen() {
  return (
    <TestScreen/>
  );
}
const Tab = createBottomTabNavigator();

export default function App() {
  return (
    <NavigationContainer style={globalStyles.buttomNa}>
      <Tab.Navigator
        screenOptions={({ route }) => ({
          tabBarIcon: ({ focused, color, size }) => {
            let iconName;

            if (route.name === 'Home') {
              iconName = focused ? 'home' : 'home'  ;
            } else if (route.name === 'Connect') {
              iconName = focused ? 'event ' : 'event';
            } else if (route.name === 'Events') {
              iconName = focused ? 'event' : 'event';
            } else if (route.name === 'Give') {
              iconName = focused ? 'event' : 'event';
            } else if (route.name === 'Listen') {
              iconName = focused ? 'volume-up' : 'volume-up';
            }

            // You can return any component that you like here!
            return <MaterialIcons name={iconName} size={size} color={color} />;
          },
        })}
        tabBarOptions={{
          activeTintColor: 'tomato',
          inactiveTintColor: 'gray',
        }}
      >
        <Tab.Screen name="Home" component={HomeScreen} />
        <Tab.Screen name="Connect" component={ConnectScreen} />
        <Tab.Screen name="Events" component={EventsScreen} />
        <Tab.Screen name="Give" component={GiveScreen} />
        <Tab.Screen name="Listen" component={ListenScreen} />
      </Tab.Navigator>
    </NavigationContainer>
  );
}
